        "skill": "JavaScript",
        "src": javascriptLogo
    },
    {
        "id": 7,
        "skill": "Node.js",
        "src": nodejsLogo
    },
    {
        "id": 8,
        "skill": "HTML5/CSS3",
        "src": htmlcssLogo
    },
    {
        "id": 9,
        "skill": "Bootstrap",
        "src": bootstrapLogo
    },
    {
        "id": 10,
        "skill": "Tableau",
        "src": TableauSkillLogo
    }
];

export default skills;
